import moment from "moment";
import React, { useState } from "react";
import { CalendarContainer, CalendarWeekContainer } from "../styledComponent/style.js";

function Calendar() {
    const year = 2022;
    const month = 5; // 6월꺼를 보고 싶으면 monthdp 5을 입력해야함.

    const startOfMonth = moment().year(year).month(month).startOf("month").format("e");
    const endOfMonth = moment().year(year).month(month).endOf("month").format("e");
    return (
        <CalendarContainer>
            <CalendarWeekContainer>1</CalendarWeekContainer>
            <CalendarWeekContainer>2</CalendarWeekContainer>
            <CalendarWeekContainer>3</CalendarWeekContainer>
            <CalendarWeekContainer>4</CalendarWeekContainer>
            <CalendarWeekContainer>5</CalendarWeekContainer>
            <CalendarWeekContainer>6</CalendarWeekContainer>
            <CalendarWeekContainer>7</CalendarWeekContainer>
        </CalendarContainer>
    );
}

export default Calendar();
